import React, { useState } from "react";

// Pages are good for organizing multiple components together

import testP from "../resources/test.jpeg";

function About() {
  return (
    <div className="App">
      <h1>About Us</h1>
      <div className="content">
        <img src={testP} alt="React Image"/>
        <p>
          Enviroment tracker keeps track of a wide range of atmospheric readings from arduinos spread out across an area. Based on the readings from these devices the 
          map will display the readings and a circle aroudn the arduinos location if the readings get to deadly levels as you can see in the picture.
        </p>
      </div>
    </div>
  );
}

export default About;
